      [|-8.; 3.; 1.;-5.; 2.; -8.; 3.; 1.;-5.; 2.;-8.; 3.; 1.;-5.; 2.; -8.; 3.; 1.;-5.; 2.; -8.; 3.; 1.;-5.; 2.;-8.; 3.; 1.;-5.; 2.|];
